import logo from './logo.svg';
import './App.css';
import axios from 'axios'
import { useState, useEffect } from 'react'

function App() {
  let [message, setMessage] = useState('');

  useEffect(()=>{
    axios.get('/hello')
         .then(res=>{
            console.log(res.data);
            setMessage(res.data);
         })
         .catch(()=>console.log('실패'))
  })

  return (
    <div className="App">
      <header>
        <nav>메뉴</nav>
      </header>
      <main>메인</main>
      <footer>푸터</footer>
    </div>
  );
}

export default App;
